import { useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import axios from 'axios';


function Register(){

   //const [firstName, setFirstName] = useState("");
    var[firstNameError, setFirstNameError]=useState("")
   // const [lastName, setLastName] = useState("");
    var[lastNameError,setLastNameError]=useState("")
    //const [email, setEmail] = useState("");
    var[emailError,setEmailError]=useState("");
    //const [mobileNo, setMobileNo] = useState("");
    var[mobileNoError,setMobileNoError]=useState("");
   // const [password, setPassword] = useState("");
    var[passwordError,setPasswordError]=useState("");
   // const [userType, setuserType] = useState('Customer');
    var[userTypeError,setUserTypeError]= useState("");

    const[user,setUser]=useState({firstName:" ",lastName:" ",email:" ", password:"", mobileNo:"",userType:" "});



    const url = "http://127.0.0.1:9999/register";

    const OnTextChage =(args)=>{
        var copyOfUser={...user};
        copyOfUser[args.target.name]=args.target.value;
        setUser(copyOfUser);
    }
    
    // const OnTextChageFirstName=(args)=>{
    //     setFirstName(args.target.value);
    // }

    // const OnTextChageLastName=(args)=>{
    //     setLastName(args.target.value);
    // }

    // const OnTextChageEmail=(args)=>{
    //    setEmail(args.target.value);
    // }
    
    // const OnTextChagMobileNo=(args)=>{
    //     setMobileNo(args.target.value);
    // }
    // const OnTextChagePassword=(args)=>{
    //     setPassword(args.target.value);
    // }
    
    // const OnTextChageUserType=(args)=>{
    //     setuserType(args.target.value);
    // }
    
    const Validate=()=>{
        //initially set to empty 
        setEmailError("");
        setPasswordError("");

        if(firstName===""){
            setFirstNameError("*Please Enter Your Email")
           
        }
        if(lastName===""){
            setLastNameError("*Please Enter Your Email")
            
        }
        if(mobileNo===""){
            setEmailError("*Please Enter Your Email")
           
        }
        if(email===""){
            setEmailError("*Please Enter Your Email")
           
        }
        if (!/^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/.test(email)) {
            setEmailError("*Please enter a valid email")
           
        }
        if(""===password)
        {
            setPasswordError("*Please Enter your Password");
        }   
        if(password.length<8){
            setPasswordError("*Password must be  8 characters or Longer");
           
        }
    };


    return (
      <div className="container">
          <center>
            <br/>
            <br/>
            <br/>
            <br/>
            <form>
                <div>
                    First Name: <input type="text" value={firstName}  onChange={OnTextChage} />
                    <label className="text-danger">{firstNameError}</label>
                </div>
                <br/>
                <div>
                    Last Name: <input type="text" value={lastName} onChange={OnTextChage}  />
                    <label className="text-danger">{lastNameError}</label>
                </div>
                <br/>
                <div>
                    Email:  <input  type="email"  value={email} onChange={OnTextChage}  />
                    <label className="text-danger">{emailError}</label>
                </div>
                <br/>
                <div>
                    Password: <input type="password" value={password} onChange={OnTextChage} />
                    <label className="text-danger">{passwordError}</label>
                </div>
                <br/>
                <div>
                    Mobile Number: <input type="tel" value={mobileNo} onChange={OnTextChage} />
                    <label className="text-danger">{mobileNoError}</label>
                </div>
                <br/>
                <div>
                    UserType: <select value={userType} onChange={OnTextChage}>
                                <option value="0">Owner</option>
                                <option value="1">Customer</option>
                                </select>
                    <label className="text-danger">{userTypeError}</label> 
                </div> 
                <br/>
                <br/>
                <button className="btn btn-primary" onClick={Validate}> Register</button>
            </form> 
          </center>
      </div>
    );
  
}

export default Register;
